import React from 'react';
import themeSection from '../../style/sections/themeSection.css'; 

class ThemeSection extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <section className='section-theme' backgroundImage={this.props.image}>
                <h1 className="section-theme__title">
                    {this.props.title}
                </h1>
            </section>
        )
    }


}

export default ThemeSection;
